import styles from "./AboutMePage.module.scss";
import { SkillsList } from "../../components/SkillsList/SkillsList";

export const AboutMePage = () => {
  return (
    <div className={styles.about}>
      <h2 className={styles.about_normal}>My <span className={styles.about_cursive}>Background</span></h2>
      <h2 className={styles.about_normal}>My <span className={styles.about_cursive}>Skills</span></h2>
      <div className={styles.skills_container}>
        <SkillsList />
      </div>
    </div>
  );
};
